import React from 'react';
import './App.css';

function App() {
  const handleBotLink = () => {
    window.location.href = "http://your-bot-link.com"; // Replace with your bot's URL
  };

  return (
    <div className="landing-page">
      <header className="header">
        <h1>Welcome to Git Patrol Bot</h1>
        <p>Your assistant for maintaining respectful communication in GitHub repositories.</p>
        <button onClick={handleBotLink} className="bot-button">Go to Bot</button>
      </header>
      <section className="features">
        <h2>Features</h2>
        <ul>
          <li>Automated sentiment analysis for issues and comments.</li>
          <li>Constructive responses to negative sentiments.</li>
          <li>Easy integration with GitHub repositories.</li>
          <li>Customizable negative words list and responses.</li>
        </ul>
      </section>
      <footer className="footer">
        <p>Â© 2024 Git Patrol Bot. All rights reserved.</p>
      </footer>
    </div>
  );
}

export default App;
